import React from 'react';
import './style.css';

function MapMarker({ key, title, lat, lng, displayCampground }) {    
  return (
    <i 
      className="fas fa-campground fa-lg map-marker"
      key={key}
      // title={title}
      lat={lat}
      lng={lng}
      onClick={displayCampground}
    ></i>
  )
}

export default MapMarker;
